# Start with a nice title for the report
$HTML .= qq(
    <h1>Environment Inventory Report</h1>
);

# Process general info section
$HTML .= qq(
    <div id="siteInfo">
        <h3>Search Filter:</h3>
        <input type="text" id="searchInput"/>
