		</tr>
);
my $environments=$ec->getEnvironments("Stores")->{responses}[0]->{environment};
for my $environment (@{$environments}) {
	my $environmentName = $environment->{environmentName};
	my $projectName = $environment->{projectName};

	my $inventories=$ec->getEnvironmentInventoryItems("$projectName","$environmentName")->{responses}[0]->{environmentInventoryItem};
	$HTML .=qq(<tr><td style="width: 250px; text-align: left; font-size:  16px;"><svg class="sds-svg-icon sds-svg-icon--icon-environments-static sds-svg-icon--no-left-offset" style="width: 30px; height: 20px; margin-right: 15px;"><use xmlns:xlink="http://www.w3.org/1999/xlink" xlink:href="#icon-environments-static"></use><g><title></title><rect x="0" y="0" width="100%" height="100%" fill="transparent" stroke="transparent"></rect></g></svg>$environmentName</td><td><table class="inside"><tr>);
	for my $environmentInventoryItem (@{$inventories}) {
		my $projectName1 = $environmentInventoryItem->{projectName};
		my $environmentName1 = $environmentInventoryItem->{environmentName};
		my $resourceName = $environmentInventoryItem->{resourceName};
		my $applicationName = $environmentInventoryItem->{applicationName};
		my $applicationTierName = $environmentInventoryItem->{applicationTierName};
		my $componentName = $environmentInventoryItem->{componentName};
		my $artifactName = $environmentInventoryItem->{artifactName};
		my $artifactVersion = $environmentInventoryItem->{artifactVersion};
		my $deploymentTime = $environmentInventoryItem->{deploymentTime};
                $HTML .=qq(<td style="text-align: center;"><table style="width: 80px; box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.2), 0 6px 20px 0 rgba(0, 0, 0, 0.19); text-align: center;"><tr style="text-align: left;"><td><svg class="sds-svg-icon sds-svg-icon--icon-component"><use xmlns:xlink="http://www.w3.org/1999/xlink" xlink:href="#icon-component"></use><g><title>Application Component</title><rect x="0" y="0" width="100%" height="100%" fill="transparent" stroke="transparent"></rect></g></svg>$componentName</td></tr><tr><td>$artifactVersion</td></tr></table></td>);
	}
        $HTML .=qq(</tr></table></td><td><table class="inside"><tr>);
	
	for my $environmentInventoryItem (@{$inventories}) {
		my $projectName2 = $environmentInventoryItem->{projectName};
		my $environmentName2 = $environmentInventoryItem->{environmentName};
		my $resourceName1 = $environmentInventoryItem->{resourceName};
		my $applicationName1 = $environmentInventoryItem->{applicationName};
		my $applicationTierName1 = $environmentInventoryItem->{applicationTierName};
		my $componentName1 = $environmentInventoryItem->{componentName};
		my $artifactName1 = $environmentInventoryItem->{artifactName};
		my $artifactVersion1 = $environmentInventoryItem->{artifactVersion};
		my $deploymentTime1 = $environmentInventoryItem->{deploymentTime};

                $HTML .=qq(<td style="text-align: center;"><table style="width: 170px; box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.2), 0 6px 20px 0 rgba(0, 0, 0, 0.19); text-align: center;"><tr style="text-align: left;"><td><svg class="sds-svg-icon sds-svg-icon--icon-menu-dropdown sds-svg-icon--no-offset" style="width: 10px; height: 10px;"><use xmlns:xlink="http://www.w3.org/1999/xlink" xlink:href="#icon-menu-dropdown"></use><g><title>Dropdown menu arrow</title><rect x="0" y="0" width="100%" height="100%" fill="transparent" stroke="transparent"></rect></g></svg><svg class="sds-svg-icon sds-svg-icon--icon-environment-reservation sds-svg-icon--no-offset" style="width: 22px; height: 22px; fill: #5c9d4b;"><use xmlns:xlink="http://www.w3.org/1999/xlink" xlink:href="#icon-environment-reservation"></use><g><title></title><rect x="0" y="0" width="100%" height="100%" fill="transparent" stroke="transparent"></rect></g></svg>$componentName1  version:   $artifactVersion1</td></tr><tr><td>$deploymentTime1</td></tr></table></td>);
	}
	$HTML .=qq(</tr></table></td></tr>);
	
}

$HTML .= qq(
   </table>

<script>
    $(document).ready(function () {
        $("#searchInput").keyup(function () {
            var val = $(this).val();

            $("#searchTable tr td").each(function (i) {
                var content = $(this).text();
                if (content.toLowerCase().indexOf(val) == -1) {
                    $(this).parent().hide();
                } else {
                    $(this).parent().show();
                }
            });
        });
    });
</script>

